 the latest instructions for this GamePack: "},{"text":"https://gamepacks.cronusmax.com/zen-g...","navigationEndpoint":{"clickTrackingParams":"CBQQ040EGAUiEwj1o9qc4P_6AhVMcbIKHTWeD5VI9s3-t7i0xNFR","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqay1uX2h6M1gyRE1qbURLaDVsdHJac19fZFBpUXxBQ3Jtc0tuQTNWZTgyVnZPWWNSOEQ4YnBlVC1fM0NOci1yelE2a2lnUUlJNXVReWMzT1FqaUMyY0h4NmRuRmZRa1V0amQzMWJGakdVRVB6c0NPSjVfUnFCdVF5cmhfOVljRjRyQ0dST3U5SmVDbkV1UGxJRHUyTQ\u0026q=https%3A%2F%2Fgamepacks.cronusmax.com%2Fzen-gamepacks%2Fcall-of-duty-warzone%2Fpacific-season-one\u0026v=UaMRo4b_pvY","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqay1uX2h6M1gyRE1qbURLaDVsdHJac19fZFBpUXxBQ3Jtc0tuQTNWZTgyVnZPWWNSOEQ4YnBlVC1fM0NOci1yelE2a2lnUUlJNXVReWMzT1FqaUMyY0h4NmRuRmZRa1V0amQzMWJGakdVRVB6c0NPSjVfUnFCdVF5cmhfOVljRjRyQ0dST3U5SmVDbkV1UGxJRHUyTQ\u0026q=https%3A%2F%2Fgamepacks.cronusmax.com%2Fzen-gamepacks%2Fcall-of-duty-warzone%2Fpacific-season-one\u0026v=UaMRo4b_pvY","target":"TARGET_NEW_WINDOW","nofollow":true}}},{"text":"\n\n⏱️ Here are the chapter timecodes so you can easily navigate the video:\n\nIntro: "},{"text":"00:00","navigationEndpoint":{"clickTrackingParams":"CBQQ040EGAUiEwj1o9qc4P_6AhVMcbIKHTWeD5U=","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=UaMRo4b_pvY\u0026t=0s","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"UaMRo4b_pvY","continuePlayback":true,"startTimeSeconds":0,"watchEndpointSupportedOnesieConfig":{"html5PlaybackOnesieConfig":{"commonConfig":{"url":"https://rr1---sn-8xjug5oxu-f5fs.googlevideo.com/initplayback?source=youtube\u0026oeis=1\u0026c=WEB\u0026oad=3200\u0026ovd=3200\u0026oaad=11000\u0026oavd=11000\u0026ocs=700\u0026oewis=1\u0026oputc=1\u0026ofpcc=1\u0026msp=1\u0026odeak=1\u0026odepv=1\u0026osfc=1\u0026id=51a311a386ffa6f6\u0026ip=31.11.128.139\u0
